package main

import (
	"fmt"
	"strings"
	"time"
)

func manacher(str string) string {
	adjStr := "#"
	for _, c := range str {
		adjStr += string(c) + "#"
	}

	rIndex := 0
	cIndex := 0
	maxLength := 0
	maxCenter := 0

	counter := 0
	lenArr := make([]int, len(adjStr))
	for i := 1; i < len(adjStr); i++ {
		if rIndex > i {
			lenArr[i] = min(rIndex-i, lenArr[2*cIndex-i])
			counter += 2
		} else {
			lenArr[i] = 1
			counter++
		}

		for i-lenArr[i] >= 0 &&
			i+lenArr[i] < len(adjStr) &&
			adjStr[i-lenArr[i]] == adjStr[i+lenArr[i]] {
			lenArr[i] ++
			counter += 3
		}

		if i+lenArr[i] > rIndex {
			rIndex = i + lenArr[i]
			cIndex = i
			counter++
		}
		if lenArr[i] > maxLength {
			maxLength = lenArr[i]
			maxCenter = i
			counter++
		}
	}

	fmt.Println(counter)
	return strings.Replace(adjStr[maxCenter-maxLength+1:maxCenter+maxLength], "#", "", -1)
}

func min(x, y int) int {
	if x > y {
		return y
	}
	return x
}

func longest(adjStr string) string {
	isOdd := true
	maxLength := 1
	maxCenter := 0

	counter := 0
	for i := 1; i < len(adjStr); i++ {
		length := 1
		for i-length >= 0 &&
			i+length < len(adjStr) &&
			adjStr[i-length] == adjStr[i+length] {
			length++
			counter += 3
		}

		if length > maxLength {
			maxLength = length
			maxCenter = i
			counter++
		}
	}

	for i := 0; i < len(adjStr)-1; i++ {
		length := 0
		for i-length >= 0 &&
			i+length < len(adjStr)-1 &&
			adjStr[i-length] == adjStr[i+1+length] {
			length++
			counter++
		}

		if length > maxLength {
			maxLength = length
			maxCenter = i
			counter++
			isOdd = false
		}
	}

	fmt.Println(counter)
	if isOdd {
		return adjStr[maxCenter-maxLength+1 : maxCenter+maxLength]
	} else {
		return adjStr[maxCenter-maxLength+1 : maxCenter+maxLength+1]
	}
}

func main() {
	originString := ""
	time0 := time.Now()
	result1 := manacher(originString)
	time1 := time.Now()
	result2 := longest(originString)
	time2 := time.Now()
	fmt.Printf("[%d]%s\n", time1.Sub(time0), "")
	fmt.Printf("[%d]%s\n", time2.Sub(time1), "")
	if result1 == result2 {
		fmt.Println(len(result1))
	} else {
		fmt.Println("WRONG")
	}
}
